import React from "react";
import { Route, Redirect } from "react-router-dom";

export default function ProtectedRoute({
  isAuth: isAuth,
  component: Component,
  ...rest
}) {
  return (
    <Route
      {...rest}
      render={(props) => {
        if (isAuth) {
          return <Component />;
        } else {
          return (
            <Redirect
              to={{ pathname: "/adminlogin", status: { from: props.location } }}
            />
          );
        }
      }}
    />
  );
}
